;; gorilla-repl.fileformat = 1

;; **
;;; # Regression test score
;;; 
;;; A score function to test the evolutionary algorithm side of the hybrid polynomial search.
;; **

;; @@
(ns regression-test-score
  (:require [gorilla-plot.core :as plot]
            [incanter.stats :as stats]
            ))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; **
;;; Some helper functions ... should make a libary at some point I suppose.
;; **

;; @@
(defn outer [xs ys] (vec (apply concat (mapv (fn [x] (mapv (fn [y] [x y]) ys)) xs))))

(defn transpose [m] (apply mapv vector m))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;regression-test-score/transpose</span>","value":"#'regression-test-score/transpose"}
;; <=

;; @@
(outer [1 2 3] [1 2 3])
(transpose (outer [1 2 3] [1 2 3]))


