;; **
;;; Some test data, a simple polynomial sampled on an equally spaced x-y grid.
;; **

;; @@
(def xys (outer (range 0.0 1 0.1) (range 0.0 1 0.1)))

(def test-data (mapv (fn [[x y]] (+ (* 3.0 x ) (* 4.0 y y))) xys))
